import React from "react";

const Hridmann = () => {
  return (
    <div style={{ width: "100%", height: "100%", display: "flex", justifyContent: "flex-end" }}>
      <iframe
        src="https://hridmann.com/"
        title="Hridmann"
        style={{
          width: "80%",
          height: "100%",
          border: "none",
          background: "white"
        }}
      />
    </div>
  );
};

export default Hridmann;
